    const handleClick = () => {
        console.log("log in clicked");
        const [showModal, setShowModal] = useState(true)
    };

    return (
        <>
            <nav>
                <div className="logo-container">
                    <img
                        className="logo"
                        src={colorLogo}
                        alt="logo" />
                </div>
                {< button className='nav-button'
                    onClick={handleClick}
                   // disabled={showModal}
                > Log in</button>}

                {showModal && (
                    <>
                        <AuthModel />
                    </>
                )}

            </nav></>
    );


}

export default Nav;
